import {BiUser,BiCommentDetail} from 'react-icons/bi';
import {BsFillFileEarmarkPostFill} from 'react-icons/bs';
import './App.css';
import Button from './Button';

function App() {
  return (
    <div className="App">
    <Button naam={"Posts"}><BiUser/></Button>
    <Button naam={"Users"}><BsFillFileEarmarkPostFill/></Button>
    <Button naam={"Comments"}><BiCommentDetail/></Button>
    </div>
  );
}

export default App;
